INSERT INTO `competition_types` (`id`, `name`, `code`, `description`, `status`, `created_at`, `updated_at`, `image`, `slug`, `class`, `tm_video`, `tm_file`, `date_start`, `date_end`) VALUES (1,'Adzan','ADZAN','<h5><span style=\"font-size:14px;\"><strong>a. Kategori Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SD/MI Putra A ( kelas, 1,2&nbsp;dan 3)</li>\r\n	<li>SD/ MI Putra B ( kelas 4,5&nbsp;dan 6)</li>\r\n	<li>SMP/MTS Putra</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>b. Kuota peserta</strong></span></h5>\r\n\r\n<ul>\r\n	<li>SD/MI Putra A : 30 Peserta</li>\r\n	<li>SD/MI Putra B : 30 Peserta</li>\r\n	<li>SMP/MTS Putra : 30 Peserta</li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>c. Point dan Presentase Penilaian</strong></span></h5>\r\n\r\n<ul>\r\n	<li aria-level=\"2\" style=\"list-style-type:disc\"><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Makhraj dan tajwid&nbsp;</span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">: 35</span></span></span></span></span></li>\r\n	<li aria-level=\"2\" style=\"list-style-type:disc\"><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Irama dan Suara</span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\"> : 25</span></span></span></span></span></li>\r\n	<li aria-level=\"2\" style=\"list-style-type:disc\"><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Penjiwaan dan Penghayatan </span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">: 25</span></span></span></span></span></li>\r\n	<li><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Adab dan Ketepatan Durasi&nbsp;</span></span></span></span></span><span style=\"font-size:12pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">: 15</span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h5><span style=\"font-size:14px;\"><strong>d. Teknis dan Peraturan Lomba</strong></span></h5>\r\n\r\n<ul>\r\n	<li>Peserta harus menyelesaikan registrasi COMIC X secara lengkap.</li>\r\n	<li>Peserta diwajibkan mengikuti TM (<em>Technical Meeting</em>) sesuai dengan jadwal yang diinformasikan. Semua pertanyaan di setiap lomba akan dijawab langsung oleh Penanggung Jawab lomba di TM (<em>Technical Meeting</em>).</li>\r\n	<li>Peserta diharapkan paham dan mengikuti semua peraturan yang ada di lomba Adzan.</li>\r\n	<li>Diharuskan menggunakan <strong>ADZAN SUBUH.</strong></li>\r\n	<li>Durasi perlombaan yakni 6 menit.</li>\r\n	<li>Menggunakan pakaian yang rapi.</li>\r\n	<li>Di larang menggunakan background yang tidak senonoh/ tidak sopan (Contoh : ada botol bir di background dll)</li>\r\n	<li>Peserta diharapkan mengambil video dalam One Take Shot (sekali pengambilan video).</li>\r\n	<li>Peserta dilarang mengedit video (seperti di cut, dsb).</li>\r\n	<li>Peserta diharuskan mengunggah video ke&nbsp;<em>Google Drive&nbsp;</em>masing-masing, kemudian mengunggah <em>link Google Drive&nbsp;</em>tersebut ke&nbsp;<em>Website&nbsp;</em>COMIC X. Untuk penjelasan lebih lanjut, silahkan lihat video di via&nbsp;<em>YouTube, Instagram, dan Website&nbsp;</em>COMIC X.</li>\r\n	<li>Video diawali dengan perkenalan&nbsp; peserta (Salam, Nama, No. Urut, Kategori Peserta, Asal Sekolah).</li>\r\n	<li>Peserta diharapkan mengumpulkan video tepat pada waktunya.</li>\r\n	<li>Peserta dilarang&nbsp;<em>Lipsync&nbsp;</em>saat membuat video.</li>\r\n	<li>Kualitas&nbsp;video yang dikirim harus jelas, disarankan video berkualitas 720p/HD atau 1080p/<em>full&nbsp;</em>HD.</li>\r\n	<li>Peserta diperbolehkan menggunakan alat pengeras suara, seperti Microphone, dsb.</li>\r\n</ul>',1,'2020-10-21 07:34:07','2021-12-16 09:43:27','adzan.jpg','adzan','SD, SMP','<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/YGJHaRgmooU\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>','https://drive.google.com/file/d/1pdP_mApYvsqwZU2G6QQGrFDVCTT1yM2x/view?usp=sharing','2021-02-07 00:00:00','2021-02-12 00:00:00'),(2,'Da\'i','DAI','<h5><strong><span style=\"font-size:14px;\">a. Kategori Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SD/MI (Kelas 1, 2&nbsp;dan 3)</li>\r\n	<li>SD/MI (Kelas 4, 5&nbsp;dan 6)</li>\r\n	<li>SMP/MTs</li>\r\n	<li>SMA/SMK/MA</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">b. Kuota Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SD/MI (Kelas 1, 2&nbsp;dan 3) : 25 Peserta</li>\r\n	<li>SD/MI (Kelas 4, 5&nbsp;dan 6) : 25 Peserta</li>\r\n	<li>SMP/MTs : 25 Peserta</li>\r\n	<li>SMA/SMK/MA : 25 Peserta</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">c. Tema</span></strong></h5>\r\n\r\n<ul>\r\n	<li>SD/MI (Kelas 1, 2&nbsp;dan 3) : Berbakti kepada Orang Tua.</li>\r\n	<li>SD/MI (Kelas 4, 5&nbsp;dan 6) : Sholat adalah tolok ukur amal.</li>\r\n	<li>SMP/MTs : Peran pemuda islam untuk memperkuat iman dalam perkembangan teknologi.</li>\r\n	<li>SMA/SMK/MA : Pandangan pemuda islam tentang zina.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">d. Teknis Lomba</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Para peserta sudah melakukan registrasi secara lengkap.</li>\r\n	<li>Para peserta diharapkan mengikuti semua aturan yang telah berlaku di COMIC X.</li>\r\n	<li>Peserta dilarang menggunakan konten yang bersifat rasis, sara, dan pornografi.</li>\r\n	<li>Peserta tampil dengan Bahasa Indonesia yang baik dan benar.</li>\r\n	<li>Peserta harus menyampaikan materi sesuai dengan tema yang telah ditentukan.</li>\r\n	<li>Durasi berdakwah maksimal 6 menit.</li>\r\n	<li>Perkenalan peserta meliputi (Salam, Nama, Kategori, Nomor Urut, dan Muqodimah). Selanjutnya dakwah bisa dimulai.</li>\r\n	<li>Peserta diharuskan mengupload video ke Google Drive masing-masing kemudian mengupload Link Google Drive tersebut ke Website COMIC X. Untuk penjelasan lebih jelas, bisa melihat video di Youtube, Instagram dan Website COMIC X.</li>\r\n	<li>Video dibuat se-transparan mungkin agar menghindari kecurangan dan meyakinkan dewan juri, mengingat lomba dilaksanakan secara virtual.</li>\r\n	<li>Audio harus terdengar dengan jelas.</li>\r\n	<li>Kualitas video yang dikirim disarankan yang berkualitas 720p/HD atau 1080/FULL HD.</li>\r\n	<li>Keputusan juri mutlak, tidak bisa diganggu gugat.</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">e. Durasi Lomba</span></strong></h5>\r\n\r\n<ul>\r\n	<li>6 menit / peserta</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">f. Point dan Presentasi Penilaian</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Isi : 20 point</li>\r\n	<li>Mimik &amp; Intonasi : 25 point</li>\r\n	<li>Penguasaan Materi : 30 point</li>\r\n	<li>Tata Krama &amp; Ketaatan Peraturan : 10 point</li>\r\n	<li>Aksentuasi : 15 point</li>\r\n</ol>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">g. Peraturan</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Peserta tampil dengan menggunakan Bahasa Indonesia yang baik dan<br />\r\n	benar.</li>\r\n	<li>Peserta dilarang menggunakan konten yang bersifat rasis dan sara.</li>\r\n	<li>Peserta menggunakan pakaian yang rapi dan sopan.</li>\r\n	<li>Durasi berdakwah maksimal 6 menit.</li>\r\n	<li>Batas waktu tidak boleh lebih dari 6 menit.</li>\r\n	<li>Waktu 6 menit yang diawali dengan perkenalan peserta (Salam, Nama, Kategori, Nomer Urut, dan Muqodimah). Selanjutnya dakwah bisa dimulai.</li>\r\n	<li>Untuk teks dakwah, peserta diperbolehkan untuk membuat teks orisinil sesuai tema dan kemampuan peserta sendiri. Peserta diperbolehkan untuk mencari referensi di Google, namun dilarang menjiplak karya orang lain.</li>\r\n	<li>Peserta dilarang membawa teks atau membaca teks selama berdakwah. Jika terlihat gerak-gerik peserta seperti membaca teks, maka akan dilakukan pengurangan poin.</li>\r\n	<li>Peserta diharuskan mengambil video dalam One Take Shot (sekali pengambilan video).</li>\r\n	<li>Peserta dilarang mengedit video (seperti cut video, green screen, dsb).</li>\r\n	<li>Peserta dibebaskan untuk berekspresi, baik satu sisi maupun dua sisi.</li>\r\n	<li>Peserta diperbolehkan menggunakan alat penjelas suara, seperti Microphone, dsb.\r\n	<ol>\r\n		<li>Namun memakai microphone tidak diwajibkan dan tidak menjadi patokan penilaian, jadi jika peserta yang memiliki microphone, dipersilahkan.</li>\r\n		<li>Poin pentingnya ialah audio (suara) harus jelas, jika peserta tidak menggunakan microphone, dimohon untuk kualitas audio supaya jelas terdengar.</li>\r\n	</ol>\r\n	</li>\r\n	<li>Pengambilan video peserta diwajibkan landscape.</li>\r\n	<li>Peserta dilarang lipsync</li>\r\n</ol>',1,'2020-10-21 07:34:07','2021-12-16 08:16:53','dai.jpg','dai','SD, SMP, SMA',NULL,NULL,'2021-02-07 00:00:00','2021-02-12 00:00:00'),(3,'Pop Religi','POP','<h5><strong><span style=\"font-size:14px;\">a. Kategori Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Kategori SD/MI (A) (Mencakup Putra dan Putri)</li>\r\n	<li>Kategori SD/MI (B) (Mencakup&nbsp;Putra dan Putri)</li>\r\n	<li>Kategori SMP/MTs&nbsp;(Mencakup Putra dan Putri)</li>\r\n	<li>Kategori SMA/SMK/MA (Mencakup Putra dan Putri)</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">b. Kuota Peserta</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Kategori SD/MI (A) (Kelas 1, 2, dan 3) : 25 Peserta&nbsp;</li>\r\n	<li>Kategori SD/MI (B) (Kelas 4, 5, dan 6) : 25 Peserta&nbsp;</li>\r\n	<li>Kategori SMP/MTs&nbsp;: 25 Peserta&nbsp;</li>\r\n	<li>Kategori SMA/SMK/MA : 25 Peserta&nbsp;</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">c. Tema</span></strong></h5>\r\n\r\n<ul>\r\n	<li>Ekspresikan Bakatmu Melalui Hobimu</li>\r\n</ul>\r\n\r\n<h5><strong><span style=\"font-size:14px;\">d. Teknis Pelaksanaan Lomba Pop Religi</span></strong></h5>\r\n\r\n<ol>\r\n	<li>Peserta sudah melakukan registrasi secara lengkap</li>\r\n	<li>Peserta diharapkan mengikuti semua aturan yang berlaku di COMIC X</li>\r\n	<li>Peserta Perlomabaan POP RELIGI melakukan perlombaan secara virtual berupa video</li>\r\n	<li>Kualitas Video harus jelas, disarankan 720p/HD atau 1080HD/full HD dan Audio harus terdengar jelas</li>\r\n	<li>Peserta diwajibkan melakukan video tampak seluruh bagian anggota badan dari atas kepala sampai alas kaki.</li>\r\n	<li>Peserta Menggunakan Bahasa Indonesia yang baik dan sopan.</li>\r\n	<li>Peserta menggunakan pakaian bebas rapi dan sesuai dengan ketentuan perlombaan.</li>\r\n	<li>Peserta Dilarang Menggunakan Konten yang bersifat rasis dan sara.</li>\r\n	<li>Peserta dilarang lipsync atau membawa teks selama perlombaan.</li>\r\n	<li>Jika terlihat gerak gerik peserta seperti membaca teks, maka akan dilakukan pengurangan point.</li>\r\n	<li>Panitia menyediakan 50 list lagu untuk kemudian